INSERT INTO  `items_data` VALUES
(17711, 'lv5_3_dye_con.png', 'Lv. 5 Legendary CON Dye', 'CON + 5 / STR + 1 / Dark Resistance + 25', 'Lv. 5 Legendary CON Dye (Con + 5 Str + 1 Dark Resistance + 25). Collect and take 10 unit s of this magical dye to the symbol maker in town and you will receive a symbol that boosts your abilities. Can be used after Awakening, or 3rd Liberation. All classes.', 'Легендарная Краска Ур. 5 - ВЫН', 'ВЫН+5 СИЛ+1 Сопротивление тьме +25', 'Легендарная краска ВЫН 5 ур. (ВЫН+5 СИЛ+1 Сопротивление тьме +25). Отдайте 10 флаконов этой краски Мастеру Татуировок, чтобы получить татуировку, изменяющую характеристики персонажа. Требования: Все классы после перерождения и 3-го освобождения.', 1, 1, 1, 'none', 'consume_type_stackable'),
(17712, 'lv5_3_dye_int.png', 'Lv. 5 Legendary INT Dye', 'INT + 5 / WIT + 1 / Water Resistance + 25', 'Lv. 5 Legendary INT Dye (Int + 5 Wit + 1 Water Resistance + 25). Collect and take 10 unit s of this magical dye to the symbol maker in town and you will receive a symbol that boosts your abilities. Can be used after Awakening, or 3rd Liberation. All classes.', 'Легендарная Краска Ур. 5 - ИНТ', 'ИНТ+5 МДР+1 Сопротивление воде +25', 'Легендарная краска ИНТ 5 ур. (ИНТ+5 МДР+1 Сопротивление воде +25). Отдайте 10 флаконов этой краски Мастеру Татуировок, чтобы получить татуировку, изменяющую характеристики персонажа. Требования: Все классы после перерождения и 3-го освобождения.', 1, 1, 1, 'none', 'consume_type_stackable'),
(17713, 'lv5_3_dye_wit.png', 'Lv. 5 Legendary WIT Dye', 'WIT + 5 / MEN + 1 / Wind Resistance + 25', 'Lv. 5 Legendary WIT Dye (Wit + 5 Men + 1 Wind Resistance + 25). Collect and take 10 unit s of this magical dye to the symbol maker in town and you will receive a symbol that boosts your abilities. Can be used after Awakening, or 3rd Liberation. All classes.', 'Легендарная Краска Ур. 5 - МДР', 'МДР+5 ДУХ+1 Сопротивление ветру +25', 'Легендарная краска МДР 5 ур. (МДР+5 ДУХ+1 Сопротивление ветру +25). Отдайте 10 флаконов этой краски Мастеру Татуировок, чтобы получить татуировку, изменяющую характеристики персонажа. Требования: Все классы после перерождения и 3-го освобождения.', 1, 1, 1, 'none', 'consume_type_stackable'),
(17714, 'lv5_3_dye_men.png', 'Lv. 5 Legendary MEN Dye', 'MEN + 5 / INT + 1 / Holy Resistance + 25', 'Lv. 5 Legendary MEN Dye (Men + 5 Int + 1 Holy Resistance + 25). Collect and take 10 unit s of this magical dye to the symbol maker in town and you will receive a symbol that boosts your abilities. Can be used after Awakening, or 3rd Liberation. All classes.', 'Легендарная Краска Ур. 5 - ДУХ', 'ДУХ+5 ИНТ+1 Сопротивление святости +25', 'Легендарная краска ДУХ 5 ур. (ДУХ+5 ИНТ+1 Сопротивление святости +25). Отдайте 10 флаконов этой краски Мастеру Татуировок, чтобы получить татуировку, изменяющую характеристики персонажа. Требования: Все классы после перерождения и 3-го освобождения.', 1, 1, 1, 'none', 'consume_type_stackable'),
