(17730, 'etc_bodypart_liver_i00.png', 'Earth Wyrm Body Fragment', NULL, 'Item that proves you were successful in inflicting great damage on the Earth Wyrm\'s body. Bring it to Head Priest of the Earth Daichir in the Town of Schuttgart.', 'Кусочек Мяса Земляного Червя', NULL, 'Предмет, доказывающий то, что Вы нанесли серьезные повреждения телу Земляного Червя. Отнесите его Жрецу Земли Дайчиру в Мифриловый Рудник.', 0, 0, 1, 'none', 'consume_type_normal'),
